import { useEffect } from "react";
import "materialize-css/dist/css/materialize.min.css";
import M from "materialize-css";

const Listagens = () => {
  useEffect(() => {
    // Initialize Materialize components
    M.AutoInit();
    // Initialize sidenav
    const elems = document.querySelectorAll(".sidenav");
    M.Sidenav.init(elems);
  }, []);

  // Example data for each tab
  const dataClienteConsumo = [
    { id: 1, nome: "João Silva", cpf: "123.456.789-00", telefone: "(11)98765-4321", valorConsumido: 500.00 },
    { id: 2, nome: "Maria Oliveira", cpf: "234.567.890-11", telefone: "(21)98765-4322", valorConsumido: 150.00 },
    { id: 3, nome: "Carlos Souza", cpf: "345.678.901-22", telefone: "(31)98765-4323", valorConsumido: 800.00 },
    { id: 4, nome: "Ana Costa", cpf: "456.789.012-33", telefone: "(41)98765-4324", valorConsumido: 350.00 },
    { id: 5, nome: "Ricardo Pereira", cpf: "567.890.123-44", telefone: "(51)98765-4325", valorConsumido: 120.00 },
    { id: 6, nome: "Juliana Mendes", cpf: "678.901.234-55", telefone: "(61)98765-4326", valorConsumido: 900.00 },
    { id: 7, nome: "Fernanda Silva", cpf: "789.012.345-66", telefone: "(71)98765-4327", valorConsumido: 200.00 },
    { id: 8, nome: "Roberto Lima", cpf: "890.123.456-77", telefone: "(81)98765-4328", valorConsumido: 1000.00 },
    { id: 9, nome: "Luciana Alves", cpf: "901.234.567-88", telefone: "(91)98765-4329", valorConsumido: 250.00 },
    { id: 10, nome: "Ricardo Barbosa", cpf: "012.345.678-99", telefone: "(11)98765-4330", valorConsumido: 450.00 }
  ];

  // Filtering and sorting data
  const filteredData = dataClienteConsumo
    .filter(cliente => cliente.valorConsumido > 300)
    .sort((a, b) => b.valorConsumido - a.valorConsumido);

  return (
    <div className="container">
      <nav>
        <div className="nav-wrapper">
          <a href="/" className="brand-logo">World Beauty</a>
        </div>
      </nav>

      <div className="row">
        <div className="col s12">
          <ul className="tabs">
            <li className="tab col s3"><a href="#tab1">Cliente Consumo Valor</a></li>
            <li className="tab col s2"><a href="#tab2">Cliente Maior Qtd</a></li>
            <li className="tab col s3"><a href="#tab3">Cliente Menor Consumo</a></li>
            <li className="tab col s2"><a href="#tab4">Prod/Serv Consumo</a></li>
            <li className="tab col s2"><a href="#tab5">Consumo Gênero</a></li>
          </ul>
        </div>

        {/* Tab 1 - Cliente Consumo Valor */}
        <div id="tab1" className="col s12">
          <table className="responsive-table centered">
            <thead>
              <tr>
                <th>Id</th>
                <th>Nome</th>
                <th>CPF</th>
                <th>Telefone</th>
                <th>Valor Consumido</th>
                <th>Ações</th>
              </tr>
            </thead>
            <tbody>
              {filteredData.map(cliente => (
                <tr key={cliente.id}>
                  <td>{cliente.id}</td>
                  <td>{cliente.nome}</td>
                  <td>{cliente.cpf}</td>
                  <td>{cliente.telefone}</td>
                  <td>R$ {cliente.valorConsumido.toFixed(2)}</td>
                  <td>
                    <button className="btn black white-text">Editar</button>
                    <button className="btn black white-text">Deletar</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {/* Other tabs - Similar structure for tabs 2, 3, 4, 5 */}
      </div>
    </div>
  );
};

export default Listagens;
